import React from 'react';

type TaskType = {
    id: number
    title: string
    isDone: boolean
}

type PropsType = {
    title: string
    tasks: Array<TaskType>
}

function ToDoList(props: PropsType) {
    return (
      <div>
        <h1>{props.title}</h1>

        <div>
          <input />
          <button>+</button>
        </div>

        <ul>
          <li>
            <input type='checkbox' checked />
            <span>Тестовое задание</span>
          </li>
        </ul>

        <div>
          <button>All</button>
          <button>Active</button>
          <button>Complited</button>
        </div>

      </div>
    );
}

export default ToDoList;
